import React from "react";
import { Avatar, Card } from "antd";

const UserProfile = () => {
    return (
        <Card
        actions={[
            <div key="twit"> 짹짹 <br />0</div>,
            <div key="followings"> 팔로잉 <br />0</div>,
            <div key="followers"> 팔로워 <br />0</div>,
        ]}>
            <Card.Meta
            avatar={<Avatar>
                ZC
            </Avatar>}
            title="sungoang"
            />
        </Card>
    )
};

export default UserProfile;
